import { NavLink as Link } from "react-router-dom";
import styled from "styled-components";

const NavLink = styled(Link)`
  color: #fff;
  align-items: center;
  text-decoration: none;
  padding: 0 1rem;
  height: 100%;
  &.active {
    color: #15cdfc;
    font-weight: bold;
  }
`;

const Nav = styled.nav`
  background: #4a148c;
  width: 100%;
  padding: 0;
  margin: 0;
`;

const NavBar = () => {
  const MouseOver = (event) => {
    event.target.style.background = "red";
  };
  return (
    <nav
      className="navbar navbar-expand-lg  sticky-top navbar-dark"
      style={{ width: "100%", background: "#4a148c" }}
    >
      <div className="container">
        <NavLink to="/" className="navbar-brand">
          <h1>Home</h1>
        </NavLink>
        <button
          className="navbar-toggler"
          type="button"
          data-bs-toggle="collapse"
          data-bs-target="#navbarNav"
          aria-controls="navbarNav"
          aria-expanded="false"
          aria-label="Toggle navigation"
        >
          <span class="navbar-toggler-icon"></span>
        </button>
        <div className="collapse navbar-collapse" id="navbarNav">
          <ul className="navbar-nav" style={{ height: "100%" }}>
            <li
              className="nav-item"
              onMouseOver={MouseOver}
              style={{ height: "100%" }}
            >
              <NavLink to="/construction">Construction</NavLink>
            </li>
            <li className="nav-item">
              <NavLink to="/interior-design">Interior Design</NavLink>
            </li>
            <li className="nav-item">
              <NavLink to="/renovation">Renovation</NavLink>
            </li>
            <li className="nav-item">
              <NavLink to="/about">About us</NavLink>
            </li>
          </ul>
        </div>
      </div>
    </nav>
  );
};

export default NavBar;
